import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import Cookies from "js-cookie";

const Login = () => {
  const [formData, setFormData] = useState({
    email: "",
    password: "",
  });
  const [error, setError] = useState(null); // State to handle error messages
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setError(null); // Reset any previous errors

    console.log("Login form submitted:", formData);

    axios
      .post("http://localhost:5000/api/login", formData)
      .then((response) => {
        if (response.data.token) {
          Cookies.set("token", response.data.token, { expires: 7 }); // Store token in cookies (expires in 7 days)
          console.log("Login successful:", response.data);
          setTimeout(() => {
            navigate("/");
            window.location.reload();
          }, 500);
        } else {
          setError("Login failed. Please try again."); // Error message if no token is returned
        }
      })
      .catch((error) => {
        console.error("Error:", error);
        setError("Something went wrong. Please try again later."); // Display a user-friendly error message
      });
  };

  return (
    <div className="min-h-screen bg-gray-100 flex flex-col">
      <nav className="w-full flex justify-between items-center px-8 py-4 bg-black">
        <h1 className="text-4xl font-extrabold text-white">
          <Link to="/">GHABATY</Link>
        </h1>
        <ul className="flex gap-8 text-lg text-white">
          {["Home", "Alerts", "Reports", "Contact", "About Us"].map((link) => (
            <li key={link} className="hover:text-red-400">
              <Link
                to={`${
                  link === "Home"
                    ? "/"
                    : `/${link.toLowerCase().replace(/\s+/g, "-")}`
                }`}
              >
                {link}
              </Link>
            </li>
          ))}
        </ul>
      </nav>

      <section className="flex-grow flex items-center justify-center">
        <div className="bg-white p-8 rounded shadow-md w-full max-w-md">
          <h2 className="text-2xl font-bold mb-6 text-center">Log In</h2>
          {error && (
            <p className="text-red-500 text-center mb-4">{error}</p>
          )}{" "}
          {/* Display error message */}
          <form onSubmit={handleSubmit}>
            <div className="mb-4">
              <label className="block text-gray-700">Email</label>
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                className="w-full px-3 py-2 border rounded"
                required
              />
            </div>
            <div className="mb-6">
              <label className="block text-gray-700">Password</label>
              <input
                type="password"
                name="password"
                value={formData.password}
                onChange={handleChange}
                className="w-full px-3 py-2 border rounded"
                required
              />
            </div>
            <button
              type="submit"
              className="w-full bg-blue-500 text-white py-2 rounded hover:bg-blue-600 transition duration-200"
            >
              Log In
            </button>
          </form>
          <p className="mt-4 text-center">
            Don't have an account?{" "}
            <Link to="/signup" className="text-blue-500 hover:underline">
              Sign Up
            </Link>
          </p>
        </div>
      </section>

      <footer className="bg-black text-gray-300 py-6">
        <div className="container mx-auto text-center">
          <p>&copy; 2024 Ghabaty. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
};

export default Login;
